import React, {Component} from 'react';
import './progress.styl';

class Progress extends Component {
  constructor () {

  }

  render () {
    return (
      <div 
        className="component-progress row"
        onClick={changeProgress}
        >
        <div 
          className="progress" 
          style={{width: `${this.props.process}%`}}
          ></div>
      </div>
    )
  }
}

export default Progress;
